import styled from 'styled-components';


export const BodyHomeBody = styled.div`
    width:1280px;
    height:auto;
    margin: auto;
    background-color: #ffffff;
    z-index : 1;
`;
export const BodyDiv = styled.div`
    padding:1em;
`;
export const BodyP = styled.p`
    padding: 1em;
    width: 100%;
    font-size:2em;
    text-align:center;
    z-index : 1;
`;
export const Objet = styled.div`
    display : flex;
    flex-wrap: wrap;
    margin: auto;
    list-style: none;
`;
export const CoteTexte = styled.div`
    width:640px;
    padding: 1em;
    font-size:2em;
    text-align:center;
    z-index : 1;
    :hover {
        background-color: #BEBEBE;
    }
`;
export const CoteImageParent = styled.div`
    margin : auto;
    width:500px;
    heigth:500px;
`;
export const CoteImage = styled.div`
    display: flex;
`;
